  state = {
    dogs: [{"url":""},{"url":""},{"url":""},{"url":""},{"url":""},{"url":""}]
  }

  componentDidMount() {
    let dogsArray = [];

    for (let i=0 ; i<=5; i++) {
      getImage().then(dog => {
        dogsArray.push({dog});
        console.log ("dogsArray" , dogsArray)

      });
    }
    this.setState({dogs:dogsArray})
  }

  render() {
    console.log("state" , this.state.dogs)
    return (
      <div className="App">
        <Header></Header>
        <DisplayDog
        dog = {this.state.dogs[0]}
        ></DisplayDog> 
        <DisplayDog
        dogs = {this.state.dogs[1]}
        ></DisplayDog>
      </div>
    );
  }
}
export default App;
